import React from 'react';
import './Services.css';

const Services = () => {
    return (
        <div className="services-container">
            <h1>Our Services</h1>
            <ul>
                <li>Home Cleaning</li>
                <li>Beauty & Salon</li>
                <li>Appliance Repair</li>
                <li>Carpentry</li>
                <li>Electrician</li>
            </ul>
        </div>
    );
};

export default Services;
